import React from 'react';






const Music = (props) => {
return(
    <div className='music'>


            <iframe src="https://open.spotify.com/embed/playlist/37i9dQZF1DXe6bgV3TmZOL" width="1200" height="500"
                    frameBorder="0" allowTransparency="true" allow="encrypted-media"></iframe>

        </div>
    

)
}

export default Music;
